from PyQt5.QtGui import QIcon, QImage, QPixmap
from haige_py.Lib.base64Lib import base64_to_bytes
from haige_py.Lib.pathLib import resource_path

ABOUT_ME_PICTURE_OBJECT = ''


def get_app_icon(path="app.ico"):
    return QIcon((resource_path(path)))


def get_about_pixmap(fp=None):
    if fp is None:
        return QPixmap.fromImage(QImage.fromData(base64_to_bytes(ABOUT_ME_PICTURE_OBJECT)))
    else:
        return QPixmap.fromImage(QImage.load(fp))
